import React from "react";
import { social } from "../data/dummydata"

const Footer = () => {
  return (
    <>
      <footer>
        {social.map((item) => (
          <>
            <i data-aos="zoom-in"> {item.icon} </i>
          </>
        ))}

        <p data-aos="zoom-in">Created by ignis T_T ©️ All Right Reserved 2022</p>
      </footer>
    </>
  );
};

export default Footer;
